@hadahaa is a pearl in the turquoise Indian Ocean. 50 luxury villas share this remote island: 14 over water and 36 amidst the jungle. Park Hyatt’s savoir faire meets Maldivian charms for a truly unique experience stay!
____________________________________
I’ve teamed up with this amazing property to offer you a 30% off the standard rates on direct bookings on any of their villas. Simply email their reservations team and mention my name and the code “WNDR18”. Paradise was never easier to visit!

WHAT WOULD YOU GIVE to spend a week in an beach like that? 
@blondiewanderlust would give her full shoe collection! Beat that!
That's been all from Seychelles for now, and will start a new series next week! If you are craving more island vibe pics, head on over to @kempinski_seychelles, as they will be posting more of mine too!
